import React from 'react';
import Body from '../Body';
import Footer from '../Footer';
import Sidebar from '../Sidebar';
import './Homepage.css'

const Homepage = () => {
    return (
        <div className='homepage'>
            <div className='homepage'>
                <Sidebar></Sidebar>
                <Body></Body>
            </div>
                <Footer className="now-playing-bar"></Footer>
        </div>
    );
};

export default Homepage;
